import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const RipenessResult = ({ ripeness, count, variety, ripenessDate }) => (
  <View style={styles.resultContainer}>
    <Text style={styles.label}>Ripeness:</Text>
    <Text style={styles.value}>{ripeness}</Text>
    <Text style={styles.label}>Count:</Text>
    <Text style={styles.value}>{count}</Text>
    <Text style={styles.label}>Variety:</Text>
    <Text style={styles.value}>{variety}</Text>
    <Text style={styles.label}>Ripeness Date:</Text>
    <Text style={styles.value}>{ripenessDate}</Text>
  </View>
);

const WatermelonRipenessResult = () => {
  const watermelonData = [
    { ripeness: 'Unripe', count: 10, variety: 'Sugar Baby', date: '04/10/24' },
    { ripeness: 'Unripe', count: 9, variety: 'Sugar Baby', date: '04/10/24' },
    // ... rest of your data
  ];

  return (
    <View style={styles.container}>
      {watermelonData.map((data, index) => (
        <RipenessResult key={index} {...data} />
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
  },
  resultContainer: {
    marginBottom: 10,
  },
  label: {
    fontWeight: 'bold',
  },
  value: {
    marginTop: 5,
  },
});

export default WatermelonRipenessResult;
